description:
The Sine class defines easing functionality using a Sine function. Easing consists of two phases: the acceleration, or ease in phase, followed by the deceleration, or ease out phase. Use the <code>easeInFraction</code> property to specify the percentage of an animation accelerating.   <p>The <code>&lt;s:Sine&gt;</code> tag inherits all of the tag attributes of its of its superclass, and adds the following tag attributes:</p>  <pre>
 &lt;s:Sine
 id=&quot;ID&quot;
 /&gt;
 </pre>
